ttom:0pt;line-height:1.0;orphans:2;widows:2;text-align:left}.c21{color:#695d46;text-decoration:none;vertical-align:baseline;font-size:14pt;font-family:"Open Sans";font-style:normal}.c22{padding-top:6pt;padding-bottom:0pt;line-height:1.2;orphans:2;widows:2;text-align:left}.c9{padding-top:10pt;padding-bottom:0pt;line-height:1.0;orphans:2;widows:2;text-align:center}.c19{color:#695d46;text-decoration:none;vertical-align:baseline;font-size:42pt;font-family:"PT Sans Narrow";font-style:normal}.c20{background-color:#ffffff;max-width:468pt;padding:54pt 72pt 54pt 72pt}.c6{padding:0;margin:0}.c16{margin-left:36pt}.c14{height:11pt}.c13{font-weight:700}.c5{padding-left:0pt}.title{padding-top:16pt;color:#695d46;font-weight:700;font-size:42pt;padding-bottom:0pt;font-family:"PT Sans Narrow";line-height:1.0;orphans:2;widows:2;text-align:left}.subtitle{padding-top:10pt;color:#695d46;font-size:14pt;padding-bottom:0pt;font-family:"PT Sans Narrow";line-height:1.0;orphans:2;widows:2;text-align:left}li{color:#695d46;font-size:11pt;font-family:"Open Sans"}p{margin:0;color:#695d46;font-size:11pt;font-family:"Open Sans"}h1{padding-top:24pt;color:#ff5e0e;font-weight:700;font-size:18pt;padding-bottom:0pt;font-family:"PT Sans Narrow";line-height:1.3;page-break-after:avoid;text-align:left}h2{padding-top:16pt;color:#008575;font-size:16pt;padding-bottom:0pt;font-family:"PT Sans Narrow";line-height:1.0;orphans:2;widows:2;text-align:left}h3{padding-top:10pt;color:#695d46;font-size:14pt;padding-bottom:0pt;font-family:"PT Sans Narrow";line-height:1.0;orphans:2;widows:2;text-align:left}h4{padding-top:8pt;-webkit-text-decoration-skip:none;color:#666666;text-decoration:underline;font-size:11pt;padding-bottom:0pt;line-height:1.2;page-break-after:avoid;text-decoration-skip-ink:none;font-family:"Trebuchet MS";orphans:2;widows:2;text-align:left}h5{padding-top:8pt;color:#666666;font-size:11pt;padding-bottom:0pt;font-family:"Trebuchet MS";line-height:1.2;page-break-after:avoid;orphans:2;widows:2;text-align:left}h6{padding-top:8pt;color:#666666;font-size:11pt;padding-bottom:0pt;font-family:"Trebuchet MS";line-height:1.2;page-break-after:avoid;font-style:italic;orphans:2;widows:2;text-align:left}</style></head><body class="c20"><p class="c7 title" id="h.43yys6gdmyn9"><span class="c19 c13">&nbsp; &nbsp;Pitch Document</span></p><p class="c8 subtitle" id="h.t3bdd59sj4t1"><span class="c11">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Edu - Tech solution enabling educators to write and distribute books across India.</span></p><p class="c10"><span class="c12"></span></p><p class="c22"><span class="c4">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p class="c10"><span class="c4"></span></p><p class="c22"><span class="c4">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Introduction</span></p><p class="c16 c18"><span class="c3">Start-Up Overview</span></p><p class="c18 c16 c14"><span class="c3"></span></p><p class="c0"><span>Our Startup is focusing on the </span><span class="c13">edu-tech</span><span class="c12">&nbsp;sector. </span></p><p class="c0"><span>We are seeing rapid growth in online education despite </span><span class="c13">some major problems</span><span class="c12">.</span></p><p class="c0"><span>The Biggest problem is the </span><span class="c13">lack of study material and books</span><span class="c12">.</span></p><p class="c0"><span class="c12">If I tell you to prepare for civil services or any other competitive exams through pdf in your smartphone, which will require you to solve hundreds and thousands of problems, study day and night to clear the exam. so, will you be able to study properly with a PDF. No, it doesn&#39;t sound that practical, but that&#39;s what&#39;s happening right now.</span></p><p class="c0"><span class="c12">Usually if we look at the market of academic books. We see that the market is dependent on the institute and the teachers of that particular field.</span></p><p class="c0"><span class="c12">Therefore, students study from the books suggested by their respective teachers.</span></p><p class="c0"><span class="c12">and those who are the authors of these academic books are teachers.</span></p><p class="c0"><span class="c12">Now the problem is that online teachers are not able to provide their study material across India and they just say to download PDF and study from it, which is again not a practical solution.</span></p><p class="c0"><span class="c12">HELLO See if a Delhi based teacher is teaching online and his students are from different parts of India. How is he going to provide study material and books to those students.</span></p><p class="c0"><span class="c12">writing a book is a hectic task in itself. Designing interior pages and exterior cover of books. Either you need to learn software tools like Photoshop and MS-Word or you need to hire someone to do so. This can cost you 3 to 6 months or about one lakh rupees. Even if you write it, you need to figure out a way to print that stuff and then distribute it across india.</span></p><p class="c0"><span class="c12">Wait, how will you find out how many copies you should print. Because if it does not sell then you will lose your money and time.</span></p><p class="c0"><span class="c12">So, we came up with the idea to create a very simple to use online platform, just to solve these problems.</span></p><p class="c0"><span class="c12">Our user friendly platform provides solutions from designing to distribution of books for online educators.</span></p><p class="c9"><span>&nbsp;</span><span class="c3">Need / The Problem Our Start-Up Solve</span></p><p class="c9 c14"><span class="c3"></span></p><ul class="c6 lst-kix_vyco8d4y530p-0 start"><li class="c2 c5"><span class="c4">What are the students trying to do?</span></li></ul><p class="c2"><span class="c12">They want to study but are unable to do so by PDF.</span></p><ul class="c6 lst-kix_yzubs1q7p29o-0 start"><li class="c2 c5"><span class="c4">Why are online educators telling students to download and to study from PDF ?</span></li></ul><p class="c2"><span class="c12">Because they do not have convenient options.</span></p><ul class="c6 lst-kix_yzubs1q7p29o-0"><li class="c2 c5"><span class="c4">What are the barriers for online Educators to publish and distribute &nbsp;their books?</span></li></ul><p class="c2"><span class="c12">There are a lot of different processes for writing, publishing and distributing a book. These will require a lot of money and time.</span></p><ul class="c6 lst-kix_2h1x7j7tvpw7-0 start"><li class="c2 c5"><span class="c13">Why can&#39;t we ignore this problem ?</span></li></ul><p class="c2"><span class="c12">Despite efforts by other companies, online education is not going to be as effective as offline education because PDF cannot replace books.</span></p><p class="c2"><span class="c12">When it comes to education, books have their own meaning, students cannot study properly on a flashing screen for many reasons.</span></p><ul class="c6 lst-kix_9px09hl8lu6-0 start"><li class="c2 c5"><span class="c4">What are the main difficulties and challenges ?</span></li></ul><ol class="c6 lst-kix_6wip2mrffsh-0 start" start="1"><li class="c1"><span class="c12">To write a Book, A book has its own layout of format. In order to write a book one needs to learn editor software like Word to achieve that and to type all the manuscripts.</span></li><li class="c1"><span class="c12">Design its cover page, One needs to learn designing or has to pay someone.</span></li><li class="c1"><span class="c12">To Print That Book, Contact some publisher to print. Again, publishers only consider a famous writer in order to maintain his inventory and losses.</span></li><li class="c1"><span class="c12">Distribute it across India.</span></li></ol><ul class="c6 lst-kix_dz9l09wsnbpn-0 start"><li class="c2 c5"><span class="c4">What are the current solutions underperforming ?</span></li></ul><p class="c2"><span class="c12">Despite the large and growing market for online education. There is no solution to these problems.</span></p><p class="c8 c14"><span class="c4"></span></p><p class="c8 c14"><span class="c4"></span></p><hr style="page-break-before:always;display:none;"><p class="c8 c14"><span class="c4"></span></p><p class="c9"><span class="c3">Our Solution To These Problems</span></p><p class="c8"><span class="c3">We are creating</span></p><ul class="c6 lst-kix_25at7936q3uh-0 start"><li class="c2 c5"><span class="c3">An Author space where educators can go and Create their book very easily.</span></li><li class="c2 c5"><span class="c3">An Online Bookstore to sell those books.</span></li><li class="c2 c5"><span class="c3">An integrated system to connect to the print house.</span></li></ul><p class="c8"><span class="c3">How These exactly work</span></p><p class="c8"><span style="overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 416.00px;"><img alt="" src="images/image1.png" style="width: 624.00px; height: 416.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);" title=""></span></p><p class="c8"><span class="c3">Author can simply scan their document with a smartphone camera to add text ( this will decrease the amount of typing as Teachers usually have notes written somewhere ).</span></p><p class="c8"><span class="c3">Author can also scan a hand-written document ( This feature will make the writing job super easy ).</span></p><p class="c8"><span class="c3">They don&rsquo;t need to design the cover page.</span></p><p class="c8"><span class="c3">We will ask them all the details like book title, author name etc. All information will be automatically updated on the pre-designed cover page.</span></p><p class="c8"><span class="c3">However they got a ton of options of pre-designed cover pages. We&#39;ll also give them a feature to edit it in future updates.</span></p><p class="c8"><span class="c4">When books get completed, it automatically gets live on our bookstore.</span></p><p class="c8"><span class="c4">Students can visit the Online Bookstore to buy.</span></p><p class="c8"><span class="c4">When we get an order then we assign a print house to print it ( This way we don&rsquo;t need to keep any stock of books; this process is called on-demand printing ).</span></p><p class="c8 c14"><span class="c4"></span></p><p class="c8"><span class="c4">Details</span></p><p class="c9"><span class="c3">Market Size</span></p><ul class="c6 lst-kix_uxym7572nyu7-0 start"><li class="c2 c5"><span class="c3">How big can this market be ?</span></li></ul><p class="c2"><span class="c13 c15">The online education market in India was valued at INR 39 billion in 2018 and is expected to reach INR 360.3 billion by 2024, expanding at a CAGR of ~43.85% during the 2019-2024 period. Ease of learning, flexibility, and a wide range of study materials have influenced the overall growth of the industry.</span></p><p class="c2"><span class="c15 c13">Many online ed-tech companies like Unacademy, byju&#39;s, vedantu are creating an impact on online-education.</span></p><p class="c2"><span class="c15 c13">Many individual educators are making educational videos on youtube.</span></p><p class="c2 c14"><span class="c15 c13"></span></p><ul class="c6 lst-kix_xci5ufomcfzq-0 start"><li class="c2 c5"><span class="c4">Target Market</span></li></ul><p class="c2"><span class="c4">Many companies are using the subscription model for their online educational videos.</span></p><p class="c2"><span class="c4">On youtube educators are getting recurring views on their content.</span></p><p class="c2"><span class="c4">This means students are regular on those channels</span></p><p class="c2"><span class="c4">We believe that those students will definitely buy books from their educators.</span></p><p class="c2"><span class="c4">And at first we&rsquo;ll target those educators.</span></p><p class="c2"><span class="c13">We are also planning to test the market by inviting educators to use our beta version of the application.</span></p><p class="c9"><span class="c3">Customer Segment</span></p><ul class="c6 lst-kix_pxsfyytz8e22-0 start"><li class="c2 c5"><span class="c3">Who are the customers ?</span></li></ul><p class="c2"><span class="c17">We are working with both Educators and students but our end customers are students who will buy books from our online store.</span></p><ul class="c6 lst-kix_pxsfyytz8e22-0"><li class="c2 c5"><span class="c3">Educators go to our author space and create the book.</span></li><li class="c2 c5"><span class="c3">Those books get available to be sold at our store.</span></li><li class="c2 c5"><span class="c3">Finally the students go to the store to buy books.</span></li><li class="c2 c5"><span class="c3">Here, You noticed that we are targeting educators but our end-users are students.</span></li><li class="c2 c5"><span class="c3">Educators will recommend their students on their platform to visit our bookstore site and to buy books which are written by educators.</span></li></ul><p class="c2 c14"><span class="c3"></span></p><ul class="c6 lst-kix_pxsfyytz8e22-0"><li class="c2 c5"><span class="c3">We&rsquo;ll mainly focus on educators and enhance our software according to them.</span></li></ul><p class="c9 c16 c14"><span class="c3"></span></p><p class="c9 c16"><span class="c13 c21">Marketing Plan</span></p><ul class="c6 lst-kix_swgmqmdfjm4l-0 start"><li class="c2 c5"><span class="c4">Marketing Goal</span></li></ul><p class="c2"><span class="c4">Our Marketing Goal in the first year is to target educators of unacademy platforms because they teach mostly for competitive exams.</span></p><ul class="c6 lst-kix_cfkkh1mgip1j-0 start"><li class="c2 c5"><span class="c4">How are we going to target specific educators &nbsp;of unacademy ?</span></li></ul><p class="c2"><span class="c4">As this platform will help Online educators to enhance their career also we can use an invite system.</span></p><p class="c2"><span class="c4">We can also use online advertising on linkedin, Facebook and Google to specifically target educators.</span></p><p class="c2"><span class="c4">We can partner with influencers to create awareness &nbsp;videos.</span></p><p class="c9 c16 c14"><span class="c4"></span></p><p class="c9 c16"><span class="c3">Our Partners</span></p><p class="c2"><span class="c3">Since, we have to print the books</span></p><p class="c2"><span class="c3">We&rsquo;ll partner with Medium Size Print House Across India. This will also create employment opportunities. </span></p><p class="c2"><span class="c4">We decided to partner with a print house because if we try to own a print house initially the system will become very rigid. To pivot in future will become gradually very hard.</span></p><p class="c2"><span class="c4">Distribution Partner</span></p><p class="c2"><span class="c13">To distribute books across india we are looking to partner with shipping companies, they generally operate in all shipping pin codes in India.</span></p><p class="c9"><span class="c13">&nbsp; &nbsp; &nbsp; </span><span class="c3">About Product(MVP)</span></p><p class="c2"><span class="c4">Right Now we are working on MVP</span></p><p class="c2"><span class="c4">This will enable writers to create their book and to sell it.</span></p><p class="c2"><span class="c4">It contains all the minimum feature that are necessary to keep going</span></p><p class="c2"><span class="c4">We are using OCR technology ( based on ML ) to recognize text on a document.</span></p><p class="c2"><span class="c4">We are using AI to recognize handwritten stuff and equations for a seamless performance.</span></p><p class="c2"><span class="c4">We are also implementing a grammar checking system to identify spelling, grammatical mistakes and to perform proofreading.</span></p><p class="c2"><span class="c4">We are using a javascript based system to automatically design cover pages.</span></p><p class="c2"><span class="c4">Users will get lots of free cover page design option and can also buy a premium cover page design.</span></p><p class="c2"><span class="c4">Our Author Space is very easy to use and is created in a way that a user can come and finish his book for free of cost.</span></p><p class="c2 c14"><span class="c4"></span></p><p class="c9"><span class="c3">Monetization Strategies</span></p><p class="c8"><span class="c3">We&rsquo;ll charge a 30% percentage of royalty on each book that educators will sell through our platform.</span></p><p class="c9 c14"><span class="c3"></span></p><p class="c9"><span class="c3">Milestone</span></p><p class="c8"><span class="c3">Currently we are working on the MVP</span></p><p class="c8"><span class="c3">This process will take upto two-three months to get completed.</span></p><p class="c8"><span class="c3">We need initial help to launch our start-up.</span></p><p class="c8"><span class="c3">Thanking the government of India to support us</span></p><p class="c8 c14"><span class="c3"></span></p></body></html>
